import {useState} from "react";
import MenuButton from '../ReusableComponents/MenuButton';

export default function Header()  {

    let userName = prompt("Bem-vindo à nossa página! Com que nome é que te apresentas?")

    return (
        <div className="flex m-0 w-screen">
            <div className="mx-9 flex justify-evenly w-14">
                <a className=" mx-7 cursor-pointer">
                <MenuButton />
                </a>
                <h1 className="mx-4 w-3/12"> Bem vindo à Food Wish, {userName} </h1>
            </div>
        </div>
    )
}
